;; **
;;; The rendered Incanter charts play nicely with the Gorilla renderer. Let's make a table of charts.
;; **

;; @@
(defn make-row
  [order]
  [order 
   (latex-view (str "x^{" order "} - x"))
   (chart-view
    (function-plot (fn [x] (- (Math/pow x order) x)) 0 1 :y-label "" :x-label "")
    :plot-size 300 :aspect-ratio 2)])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;incanter-example/make-row</span>","value":"#'incanter-example/make-row"}
;; <=

;; @@
(table-view (map make-row (range 2 5)) :columns [(html-view "Order") (html-view "Form") (html-view "Plot")])
