;; **
;;; And another annotation example:
;; **

;; @@
(def iris (to-matrix (get-dataset :iris)))
 
(def X (sel iris :cols (range 4)))
(def species (sel iris :cols 4))
(def pca (principal-components X))
(def components (:rotation pca))
(def pc1 (sel components :cols 0))
(def pc2 (sel components :cols 1))
(def x1 (mmult X pc1))
(def x2 (mmult X pc2))
 
(def sp (scatter-plot x1 x2
                    :group-by species
                    :x-label "PC1"
                    :y-label "PC2"
                    :title "Iris PCA"))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;incanter-example/sp</span>","value":"#'incanter-example/sp"}
;; <=

