;; @@
; define basis functions
; basis functions defined as a function that takes 1 argument x and returns n values
; we want to get quadratic polynomial - it means we need basis functions 1, x, x^2
(defn basis [x] [1 x (* x x)])

(plot (interpolate points :linear-least-squares :basis basis))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/PNG;base64,\"/>","value":"#incanter_gorilla.render.ChartView{:content #object[org.jfree.chart.JFreeChart 0x1480829d \"org.jfree.chart.JFreeChart@1480829d\"], :opts nil}"}
;; <=

;; @@
; approximate points using linear equation
; to do this we need 2 basis functions: 1 and x
; so use built-in polynomial basis with 2 first functions:
(plot (interpolate points :linear-least-squares
                   :basis :polynomial :n 2))
